import React from 'react'
import Wave from 'react-wavify'

class ShowDays extends React.Component{
    render(){
        return(
            <div style={{width: '250px', height: '250px',borderRadius: '50%',background: 'yellow'}}>
                <Wave fill="#e62315" mask="url(#mask)" options={{ height:50,points: 5, speed: 0.2, amplitude: 2 }}>
                {/* Example adapted from https://developer.mozilla.org/en-US/docs/Web/SVG/Element/mask */}
                <mask id="mask">
                    <path d="
                            M0,125 A40,40,0,0,0,250,125 z" fill="white" />
                </mask>
                </Wave>
                
            </div>
        )
    }
}

export default ShowDays;
